from typing import List


class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        hash_p = dict()
        for el in p:
           if el not in hash_p:
               hash_p[el] = 1
           else:
               hash_p[el] += 1
        hash_s = dict()
        arr = []
        for i in range(len(s)):
            if s[i] not in hash_s:
                hash_s[s[i]] = 1
            else:
                hash_s[s[i]] += 1
            if (i+1) >= len(p):
                if hash_s == hash_p:
                    arr.append(i+1 - len(p))
                if hash_s[s[i + 1 - len(p)]] == 1:
                    del hash_s[s[i + 1 - len(p)]]
                else:
                    hash_s[s[i + 1 - len(p)]] -= 1
        return arr


s = Solution
print(s.findAnagrams(s, "cbaebabacd", "abc"))
print(s.findAnagrams(s, "abab", "ab"))
print(s.findAnagrams(s, "baa", "aa"))
s_1 = ""
s_2 = ""
print(s.findAnagrams(s, s_1, s_2))
